function App() {
  return (
    <div className="App">
      <Topbar />
      <div className="bg">
        <Container>
          <div className="pl-5 pt-5">
            <h1 className="text-white">Make them feel your love.</h1>
            <h6 className="text-white">
              Share the gift of healthy eating with your loved ones.
            </h6>
            <Button variant="light">Order now</Button>{" "}
          </div>
        </Container>
      </div>
    </div>
  );
}

export default App;
